import React from 'react'
import { Container } from 'react-bootstrap'

const Navbar = () => {
  return (
    <Container>
        <Container className='header'></Container>
        <Container className='navigation'>
            <h1 class>Movie ranking</h1>
        </Container>
    </Container>
  )
}

export default Navbar
